import React, { useState }from 'react';
import { AppBar, Toolbar, Typography, Tab, Tabs, MyList, ListItemButton, ListItemIcon } from '@mui/material/';
import ShoppingCartOutlinedIcon from '@mui/icons-material/ShoppingCartOutlined';
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';

export const Navbar = () => {
    const [value, setValue] = useState(0);
    const handleClickTab = (e, newValue) => {setValue(newValue);

    }
    return (
        <>
        <AppBar color='primary'>
                <Toolbar>
                    <Typography>CineNumen</Typography>
                            <Tabs onChange={handleClickTab} indicatorColor='secondary' value={value}>
                                <Tab label='Cartelera' />
                                <Tab label='Salas' />
                                <Tab label='Sucursales' />
                                <Tab label='Contacto' />
                                <ListItemButton>
                                    <ListItemIcon>
                                    <SearchOutlinedIcon sx={{ fontSize: 30 }}/>
                                    </ListItemIcon>
                                </ListItemButton>
                                <ListItemButton>
                                    <ListItemIcon>
                                    <ShoppingCartOutlinedIcon sx={{ fontSize: 30,
                                    color: 'primary'}}/>
                                    </ListItemIcon>
                                </ListItemButton>
                            </Tabs>
                </Toolbar>
            </AppBar>
        </>
    )
}
